import React from "react";
import logo from "./Logo-w.png"
import "./pinknav.css"

function PinknavLeft({title}) {
    return(
        <div className= 'pink-nav-left'>
            <h1> {title} </h1>
            <img className='foto-container' src= {logo}/>
            <button>Nieuw Project</button>
        </div>
    )
}


export default PinknavLeft
